import { BrowserModule } from '@angular/platform-browser';
import { NgModule } from '@angular/core';
import { FormsModule } from '@angular/forms';
import { HttpClientModule } from '@angular/common/http';
import { RouterLink, RouterModule, RouterOutlet } from '@angular/router';

import { AppComponent } from './app.component';

import { HomeComponent } from './home/home.component';

import { FetchDataComponent } from './fetch-data/fetch-data.component';


import { BillingDashboardComponent } from './billing/billing-dashboard/billing-dashboard.component';
import { BillCreateComponent } from './billing/bill-create/bill-create.component';
import { BillDetailsComponent } from './billing/bill-details/bill-details.component';
import { BillUpdateComponent } from './billing/bill-update/bill-update.component';

@NgModule({
  declarations: [
    RouterLink,
    router
    RouterOutlet,
    AppComponent,
    HomeComponent,
    FetchDataComponent
  ],
  imports: [
    BrowserModule.withServerTransition({ appId: 'ng-cli-universal' }),
    HttpClientModule,
    FormsModule,
    RouterModule.forRoot([
      {
        path: '', component: HomeComponent, 
        children: [
          { path: 'billing-dashboard', component: BillingDashboardComponent,
            children: [
              { path: 'bills/create', component: BillCreateComponent },
              { path: 'bills/:id/details', component: BillDetailsComponent },
              { path: 'bills/:id/update', component: BillUpdateComponent }
            ]
           },

        ] 
      },
      { path: 'fetch-data', component: FetchDataComponent },

    ])
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
